// Below can reasonably calculate the size in bytes of a String, assuming that the charset is Unicode encoded 
// using 'UTF-8', and that the actual character set utilized through out the String is one of the 128 ASCII characters,
// which is the case for Strings that use characters from the English language.
println "Bytes is ${text.getBytes('UTF-8').length}"
println "Bytes is ${'ab'.getBytes('UTF-8').length}"

//println "Bytes is text.bytes.encodeBase64()"

//println convertToBinary("T", "US-ASCII")
//println Integer.toBinaryString(255)


String convertToBinary(String input, String encoding) 
      throws UnsupportedEncodingException {
    byte[] encoded_input = Charset.forName(encoding)
      .encode(input)
      .array();  
    return IntStream.range(0, encoded_input.length)
        .map({ i -> encoded_input[i] as Integer })
        .mapToObj(e -> Integer.toBinaryString(e ^ 255))
        .map(e -> String.format('%1$' + Byte.SIZE + "s", e).replace(" ", "0"))
        .collect(Collectors.joining(' '));
}
